import Axios from 'axios';

export const createDoctor = async (doc) => {
  let res = await Axios.get(
    `http://localhost:3000/geocodes/details/${doctor.place_id}`
  );
  const detailedDoctor = res.data.result;
  const {
    formatted_address,
    formatted_phone_number,
    name,
    place_id,
    rating,
    url,
    website,
    user_ratings_total,
    geometry: {
      location: { lat, lng },
    },
  } = detailedDoctor;

  const doctorHash = {
    place_id,
    name,
    formatted_address,
    rating,
    user_ratings_total,
    formatted_phone_number,
    lat,
    lng,
    url,
    website,
  };
  const config = {
    method: 'POST',
    headers: {
      'content-type': 'application/json',
      accepts: 'application/json',
    },
  };

  const bleh = JSON.stringify(doctorHash);
  // console.log('bleh in helpersJs', bleh);
  // console.log('detailedDoctor in helpersJs', detailedDoctor);

  let returnDoc = await fetch(`http://localhost:3000/doctors`, config, bleh)


  // return doctorHash;
};
